// Versão minificada do componente React para finalizar venda
const FinalizarVenda=()=>{const e=e=>{e.preventDefault(),confirm("Tem certeza que deseja finalizar esta venda? Esta ação atualizará o estoque e não poderá ser desfeita.")&&document.getElementById("finalizar-form").submit()};return React.useEffect(()=>{const n=document.getElementById("finalizar-form");if(n)return n.addEventListener("submit",e),()=>{n.removeEventListener("submit",e)}},[]),null};document.addEventListener("DOMContentLoaded",()=>{const e=document.createElement("div");document.body.appendChild(e),ReactDOM.render(React.createElement(FinalizarVenda),e)});